 mode is\r\naccomplished through the MAU MIB.  When\r\nan interface does not support autonegotiation,\r\nor when autonegotiation is not enabled, the\r\nduplex mode is controlled using\r\nifMauDefaultType.  When autonegotiation is\r\nsupported and enabled, duplex mode is controlled\r\nusing ifMauAutoNegAdvertisedBits.  In either\r\ncase, the currently operating duplex mode is\r\nreflected both in this object and in ifMauType.\r\n\r\nNote that this object provides redundant\r\ninformation with ifMauType.  Normally, redundant\r\nobjects are discouraged.  However, in this\r\ninstance, it allows a management application to\r\ndetermine the duplex status of an interface\r\nwithout having to know every possible value of\r\nifMauType.  This was felt to be sufficiently\r\nvaluable to justify the redundancy.\r\nReference: [IEEE 802.3 Std.], 30.3.1.1.32,aDuplexStatus.',0,'30d',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0,0),(27631,3,'',10226,'ICMP ping','icmpping','1m','1w','365d',0,3,'','','','',27149,1,'','',0,'','','','',0,NULL,'',0,'30d',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0,0),(27632,3,'',10226,'ICMP loss','icmppingloss','1m','1w','365d',0,0,'','%','','',27150,NULL,'','',0,'','','','',0,NULL,'',0,'30d',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0,0),(27633,3,'',10226,'ICMP response time','icmppingsec','1m','1w','365d',0,0,'','s','','',27151,NULL,'','',0,'','','','',0,NULL,'',0,'30d',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0,0),(27634,17,'',10226,'SNMP traps (fallback)','snmptrap.fallback','1m','2w','0',0,2,'','','','hh:mm:sszyyyy/MM/dd',27157,NULL,'','',0,'','','','',0,NULL,'Item is used to collect all SNMP traps unmatched by other snmptrap items',0,'30d',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0,0),(27638,20,'1.3.6.1.2.1.1.5.0',10226,'System name','system.name','1h','2w','0',0,1,'','','','',27152,NULL,'','',0,'','','','',0,NULL,'MIB: SNMPv2-MIB\r\nAn administratively-assigned nam